      try {
        const entry = JSON.parse(line) as { ts?: number };
        if (!entry.ts) continue;
        if (minTs === null || entry.ts < minTs) {
          minTs = entry.ts;
        }
      } catch {
        // Skip malformed lines
      }
    }
    return minTs;
  } catch {
    return null;
  }
}

